var lengthOfLongestSubstring = function (s) {
  var arr = Array.from(s);
  var max = 0;
  for (var i = 0; i < arr.length; i++) {
    for (var j = i + 1; j <= arr.length; j++) {
      const tarr = arr.slice(i, j);
    //   const isUnique = !tarr.some((t, k) => tarr.indexOf(t) < k);
      const isUnique = new Set(tarr).size === tarr.length;
      if (!isUnique) break;
      if (max < j - i) {
        max = j - i;
        // console.log("max substring:", tarr);
      }
    }
  }
  console.log("longest substring count:", s, max);
  return max;
};

